To print the elements of an `ArrayList` in Java, you can use a `for` loop or the enhanced for loop (also known as a for-each loop). Here are both methods:

### 1. Using a `for` loop

```java
import java.util.ArrayList;

public class Main {
    public static void main(String[] args) {
        ArrayList<String> list = new ArrayList<>();
        list.add("Apple");
        list.add("Banana");
        list.add("Cherry");
        list.add("Date");

        // Using for loop to print elements
        for(int i = 0; i < list.size(); i++) {
            System.out.println(list.get(i));
        }
    }
}
